import React, {useState, useEffect} from "react"
import {useHistory} from "react-router-dom"
import Button from "react-bootstrap/Button"

export default function History(){
    //gallons, delivery address, delivery datae, price/gallon, amount due
    var [values, setValues] = useState([])

    //values are hard coded for now but will add functionality later(get data from api/database)
    useEffect(() => {
        const addRow = async () =>{
            setValues([{
                Gallons: 1,
                Address: 'Road rd',
                Date: 'Tomorrow',
                Price: 24,
                Due: 35,
            },
            {
                Gallons: 2,
                Address: 'Street rd',
                Date: 'Yesterday',
                Price: 12,
                Due: 37,
            }])
        }

        addRow()
    })

    //values.map() basically 
    var gallons = values.map((index) =>(
        <tr>{index.Gallons}</tr>
    ))
    var address = values.map((index) =>(
        <tr>{index.Address}</tr>
    ))
    var dates = values.map((index) =>(
        <tr>{index.Date}</tr>
    ))
    var prices = values.map((index) =>(
        <tr>{index.Price}</tr>
    ))
    var amountDues = values.map((index) =>(
        <tr>{index.Due}</tr>
    ))

    return(
        <div>
            <table>
                <tr>
                    <td>Gallons</td>
                    <td>Address</td>
                    <td>Delivery Date</td>
                    <td>Price per gallon</td>
                    <td>Amount Due</td>
                </tr>
                <td>{gallons}</td>
                <td>{address}</td>
                <td>{dates}</td>
                <td>{prices}</td>
                <td>{amountDues}</td>
            </table>
        </div>
    )
}
